// App.js
import React from 'react';
import Amplify from 'aws-amplify';
import awsconfig from './aws-exports';
import Login from './Login';
import FileUpload from './FileUpload';

Amplify.configure(awsconfig);

function App() {
  return (
    <div>
      <Login />
      <FileUpload />
    </div>
  );
}

export default App;
